import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Login from "./components/login/Login";
import Vlogin from "./components/vlogin/Vlogin";
import Signup from "./components/signup/Signup";
import OTPVerification from "./components/Otpverification/OTPVerification"; // Import OTP Component

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Login />} />
        <Route path="/vlogin" element={<Vlogin />} />
        <Route path="/signup" element={<Signup />} />
        <Route path="/otp" element={<OTPVerification />} /> {/* OTP Route */}
      </Routes>
    </Router>
  );
}

export default App;
